INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('20136734', 'Tisane Bio Détox', 'romarin*, anis vert*, menthe poivrée*, réglisse*, *Issus d\'Agriculture Biologique - Système de contrôle Mélange de plantes herbacées, florales, vivaces, les tisanes sont prisées depuis des temps très anciens. La sélection de la partie noble de la plante, dite « supérieure », est particulièrement rigoureuse, pour assembler fruit, fleur, feuille, tige et racine et révéler de mulitples combinaisons de saveurs. Vous apprécierez les vertus de ces recettes originales en liqueurs gourmandes. Cette tisane purifie votre organisme en lui offrant un break. Cet assemblage permet de recharger le corps en énergie positive. De toutes origines, nous sélectionnons nos plantes dans leur région naturelle de croissance, 100% certifiées Agriculture Biologique. Chaque plante est un organisme vivant dont les principes actifs s\'associent et se combinent par leur synergie dans chaque assemblage. Afin de maintenir les espèces et protéger notre patrimoine végétal, nous vous suggérons la remise en terre (ou en compost) de votre tisane infusée. Conseils d\'utilisation : Préparez au jour le jour vos infusions à raison d\'une infusette par tasse. Consommez 3 tasses 3 fois par Vous pouvez infuser 6 sachets dans 1 ,5L d\'eau, même froide. A boire tout au long de la journée.', 'https://static.openfoodfacts.org/images/products/20136734/front_fr.4.400.jpg', '3.9', '0', '29.89', '10.05', '5.72', '4.08', '0.0299', '0.0117716535433071', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('20136741', 'Tisane Bio Ligne', 'romarin*, pissenlit*, tilleul*, chiendent* *Issus d\'Agriculture Biologique - Système de contrôle CE. Mélange de plantes herbacées, florales, vivaces, les tisanes sont prisées depuis des temps très anciens. La sélection de la partie noble de la plante, dite « supérieure », est particulièrement rigoureuse, pour assembler fruit, fleur, feuille, tige et racine et révéler de multiples combinaisons de saveurs. Vous apprécierez les vertus de ces recettes originales en liqueurs gourmandes. Cet assemblage aide votre corps à éliminer et devient votre partenaire bien-être. De toutes origines, nous sélectionnons nos plantes dans leur région naturelle de croissance, 1 00% certifiées Agriculture Biologique. Chaque plante est un organisme vivant dont les principes actifs slassocient et se combinent par leur synergie dans chaque assemblage. Afin de maintenir les espèces et protéger notre patrimoine végétal, nous vous suggérons la remise en terre (ou en compost) de votre tisane infusée. Conseils dlutilisation : Préparez au jour le jour vos infusions à raison d\'une infusette par tasse. Consommez 3 tasses 3 fois par jour. Vous pouvez infuser 6 sacwets dans 1 ,5L d\'eau, même froide. À boire tout au long de la journée.', 'https://static.openfoodfacts.org/images/products/20136741/front_fr.4.400.jpg', '0.5', '0', '18.5', '16.75', '0', '3', '0', '0', '', '1');

